import './App.css';
import FriendList from './mocks/components/FriendsList';
import AddFriend from './mocks/components/AddFriend';
import Logout from './mocks/components/Logout';
import Login from './mocks/components/Login';

import { Switch, Route } from 'react-router-dom';



function App() {

  return (
    <div className="App">

      <Switch>
        <Route to="/login" component={Login} />
        <Route to="/FriendList" component={FriendList} />
        <Route to="/AddFriend" component={AddFriend} />
        <Route to="/login" component={Logout} />
      </Switch>

    </div>
  );
}

export default App;
